import React from 'react'
import TeamSelector from './TeamSelector';

export default class ResultWrapper extends React.Component {

    render() {
        return(
            <div className='result-wrapper'>
                <TeamSelector value='Team 1'/>
                <TeamSelector value='Team 2'/>
            </div>
        )
    }
}
